	v_nume VARCHAR2(255);
	v_prenume VARCHAR2(255);
	v_data_nastere date; 
	v_email varchar2(40);
	v_id number(10, 0);
  v_temp int;
  v_temp1 int;
  v_temp2 int;
BEGIN

	DBMS_OUTPUT.PUT_LINE('Bagam genre-urile');
	FOR v_i IN 1..21 LOOP
		insert into genres values(v_i, lista_genre(v_i));
	END LOOP;
	
	DBMS_OUTPUT.PUT_LINE('Bagam 10000 de cantece si artisti si legatura dintre ele in SANGBY si legatura intre songs si genre (CATEGORIZED)');
	FOR v_i IN 1..10000 LOOP
	
		insert into songs values(v_i, lista_songs(v_i));
		
		insert into artists(artist_id, name) values(v_i, lista_artists(v_i));	
		
		insert into categorized values(v_i, v_i, FLOOR(DBMS_RANDOM.VALUE(0, 21))+1);
		
		insert into albums values(v_i, lista_songs(v_i), 2016, lista_labels(FLOOR(DBMS_RANDOM.VALUE(0, 10))+1));

		insert into contain values(v_i, v_i, v_i);
    
    insert into sangby values(v_i, v_i, v_i);
		
	END LOOP;
	
  DBMS_OUTPUT.PUT_LINE('Bagam 10000 de useri si emailuri si legatura dintre ele in LOGIN');
	FOR v_i IN 1..10000 LOOP
		
		v_nume := lista_nume(FLOOR(DBMS_RANDOM.VALUE(0,lista_nume.count))+1);
		v_prenume := lista_prenume(FLOOR(DBMS_RANDOM.VALUE(0,lista_prenume.count))+1);
		v_data_nastere := TO_DATE('01-01-1960','MM-DD-YYYY')+FLOOR(DBMS_RANDOM.VALUE(0,14600));
		v_email := lower(v_nume ||'.'|| v_prenume || FLOOR(DBMS_RANDOM.VALUE(0,1001)+1) ||  lista_mail(FLOOR(DBMS_RANDOM.VALUE(0,lista_mail.count))+1));
    
		 
		insert into users values(v_i, v_nume, v_prenume, v_data_nastere);
		insert into credentials values(v_i, v_email, 'password');
    insert into login values(v_i, v_i, v_i);
	END LOOP;
  
  DBMS_OUTPUT.PUT_LINE('Bagam cam cate 100 de ascultari random la fiecare user');
	v_id := 1;
	FOR v_user_id IN 1..10000 LOOP
		FOR v_song IN 1..100 LOOP
			insert into listened values(v_id, v_user_id, FLOOR(DBMS_RANDOM.VALUE((v_song-1)*100, v_song*100))+1, FLOOR(DBMS_RANDOM.VALUE(0, 101))+1);
			v_id := v_id + 1;
		END LOOP;
	END LOOP;
  
  DBMS_OUTPUT.PUT_LINE('Bagam 20000 de prietenii');
  select count(*) into v_temp from users;
  FOR v_i IN 1..20000 LOOP   
       LOOP
          v_temp1 :=  FLOOR(DBMS_RANDOM.VALUE(0,v_temp-1))+1;
          v_temp2 :=  FLOOR(DBMS_RANDOM.VALUE(0,v_temp-1))+1;
          EXIT WHEN v_temp1<>v_temp2;
       END LOOP;
       DECLARE 
       BEGIN
          insert into friends values(v_i, v_temp1, v_temp2); 
          exception 
             when OTHERS then null;
       END;
   END LOOP;   

